import React, { Component } from 'react'

 class HOC extends Component {

    handleClick=()=>{
        alert("this is HOC");
    }

    render() {
        return (
            <div>
                <button onClick={this.handleClick}>HOC</button>
            </div>
        )
    }
}
export default HOC;
